<template>
	<view class="content">
		<view class="top">
			<topBar :title="'会员中心'"></topBar>
		</view>
	
		<view :class="'header ' + myInfo.bgName" :style="{'padding-top': statusBarHeight+60+'px'}" >
			<view class="userHeadImg dis-inline-block">
				<image :src="myInfo.CustomerImages" mode="" class="bg-f5"></image>
			</view>
			<view class="dis-inline-block p-top-8">
				<view class="name col-f f-32">
					{{myInfo.CustomerNick}}
					<text v-if="myInfo.CustomerVipName" class="vipName f-24"  :style="'background: rgba(244,244,244, 0.2)'">{{myInfo.CustomerVipName}}</text>
					<!-- <text class="rankName f-24">{{myInfo.CustomerRankName}}</text> -->
				</view>
				<view class="col-f f-24">{{myInfo.CustomerRank === 0 && !myInfo.CustomerPrivilege?'开通会员享受会员福利': myInfo.CustomerDiscountEndDate +'到期'}}</view>
			</view>
			<view class="dis-inline-block f-right col-f f-28 integral">积分{{myInfo.CustomerPoint}}</view>
			<view v-if="myInfo.CustomerPrivilege" class="vipPower col-f f-32 t-center oneline-hidden">{{myInfo.CustomerPrivilege}}</view>
		</view>
		<view class="p-24">
			<view v-for="(item, index) in list" :key="index" class="card-item" :style="{background: item.bgColor}">
				<view class="left-box t-center">
					<view class="f-32 money" :style="{color: item.CaseColor}">¥<text class="f-72 f-bold">{{item.CustomerCasePrice}}</text></view>
					<view class="col-3A f-28" v-for="(str, num) in item.BenefitExplain" :key="num" v-if="num < 2">{{str}}</view>
				</view>
				<view class="f-right right-box t-center">
					<view class="col-3A f-40 f-bold">{{item.CustomerCaseName}}</view>
					<view class="btn-row t-center">
						<text class="btn col-f f-bold f-32" :style="{background: isBuying?'#D8D8D8': item.CaseColor}" @click="buyNow(item, index)">立即开通</text>
					</view>
				</view>
				<view v-if="item.CaseExplain" class="info f-24 col-99">使用说明：{{item.CaseExplain}}</view>
			</view>
		</view>
		
	</view>
</template>

<script>
	import topBar from "@/components/topBar.vue"
	
	import { hexToRgba } from '@/common/utils.js'
	export default{
		components: {
			topBar
		},
		data() {
			return{
				statusBarHeight: 0,
				myInfo: {
					CustomerNick: '',
					CustomerImages: '',
					CustomerRank: '',
					CustomerRankName: '',
					CustomerPoint: 0,
					bgName: '',
					CustomerDiscount: ''
				},
				list: [],
				isBuying: false,     // 是否正在购买
			}
		},
		onLoad(e) {
			let that= this,
				info= JSON.parse(e.info)
			console.log('会员中心接收到参数', info)
			that.statusBarHeight= uni.getStorageSync('statusBarHeight')
			// 根据等级改变背景图
			switch(info.CustomerRank) {
				case 0:
					info.bgName= 'b-red'
					break
				case 1:
					info.bgName= 'b-gold'
					break
				case 2:
					info.bgName= 'b-black'
					break
			}
			if(info.CustomerDiscount) {
				info.CustomerDiscount= info.CustomerDiscount * 10 % 1 === 0? info.CustomerDiscount * 10: info.CustomerDiscount * 100
			}
			this.myInfo= info
			this.getVipList()
		},
		methods: {
			goBack() {
				uni.navigateBack({
					delta: 1
				})
			},
			async getVipList() {
				let that= this,
					res= await that.$request(that.$API.GetVipCase)
				
				res.Data.forEach((item, index) => {
					item.bgColor= hexToRgba(item.CaseColor, 0.1)
				})
				that.list= res.Data
			},
			// 购买
			async buyNow(item, index) {
				this.isBuying= true
				uni.showLoading({
					title: '唤起支付中...',
					mask: true
				})
				let that= this,
					params= {
						"VipCaseId": item.CustomerCaseId,
						"PayType": 1,
						"Appip": '',
						"CustomerCode": ''
					};
				let resCode= await that.helper.getLoginCode()
					params.CustomerCode= resCode
					let res= await that.$request(that.$API.BuyVip, params, '', true)
					if(res.Success === 0) {
						let JsonRequest= JSON.parse(res.Data.JsonRequest)
						that.payAction(res.Data.OrderNumber, JsonRequest)	
					} else {
						this.isBuying= false
					}
					
			},
			// 支付操作
			async payAction(OrderNumber, JsonRequest) {
				let that= this
				let response= await that.$WxPay(JsonRequest)
				this.isBuying= false
				if (response) {
					that.$Toast('支付成功')
					that.checkPayStatus(OrderNumber, JsonRequest)
				} else {
					that.$Toast('取消支付')
				}
				// uni.hideLoading()
			},
			// 查询支付结果
			async checkPayStatus(OrderNumber, payJson, num) {
				num= num?num: 0
				let that= this,
					paramData= {"VipCode": OrderNumber}
				let response= await that.$request(that.$API.CheckBuyVip, paramData)
				if(response) {
					uni.redirectTo({
						url: '/pagesB/payState/payState?type=1&buyVip=true'
					})	
				} else if(num < 5){
					that.checkPayStatus(OrderNumber, payJson, num)
					num++
					return
				} else {
					uni.redirectTo({
						url: '/pagesB/payState/payState?type=0&buyVip=true'
					})
				}
			}
		}
	}
</script>

